import React from 'react';
import { range } from '../../utils';
import { checkGuess } from '../../game-helpers';

function Guess({ value, answer }) {
  console.log('answer: ' + answer + 'value: ' + value);
  const checkedValue = checkGuess(value && value.answer, answer);
  console.log(checkedValue);
  const importantClass = checkedValue.status ? `cell ${checkedValue.status}` : 'cell';
  return (
    <p className='guess'>
      {range(5).map((cell) => (
        <span
          className={importantClass}
          key={value ? `${value.id}-${cell}` : cell}
        >
          {value ? value.answer[cell] : undefined}
        </span>
      ))}
    </p>
  );
}

export default Guess;
